'use client';

import { useRef, useState } from 'react';
import { Canvas } from '@react-three/fiber';
import { Environment, Float, PerspectiveCamera } from '@react-three/drei';
import { Button } from "@/components/ui/button";
import { Shield, MessageCircle, AlertTriangle } from 'lucide-react';
import LoginModal from './modals/LoginModal';
import SignupModal from './modals/SignupModal';

function Scene() {
  return (
    <>
      <PerspectiveCamera makeDefault position={[0, 2, 5]} />
      <Environment preset="night" />

      {/* Floating platform */}
      <Float
        speed={2}
        rotationIntensity={0.5}
        floatIntensity={0.5}
      >
        <mesh rotation={[-Math.PI / 2, 0, 0]} position={[0, -1, 0]}>
          <planeGeometry args={[10, 10]} />
          <meshStandardMaterial color="#1a365d" metalness={0.8} roughness={0.2} />
        </mesh>

        {/* Floating shield */}
        <mesh position={[0, 0.5, 0]}>
          <torusGeometry args={[1, 0.4, 16, 32]} />
          <meshStandardMaterial color="#3b82f6" metalness={0.8} roughness={0.2} />
        </mesh>
      </Float>

      {/* Ambient light */}
      <ambientLight intensity={0.5} />
      {/* Directional light */}
      <directionalLight position={[5, 5, 5]} intensity={1} />
    </>
  );
}

export default function Component() {
  const [isLoginOpen, setLoginOpen] = useState(false);
  const [isSignupOpen, setSignupOpen] = useState(false);
  const containerRef = useRef(null);

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-900 to-slate-800 relative overflow-hidden">
      {/* 3D Canvas */}
      <div className="absolute inset-0">
        <Canvas>
          <Scene />
        </Canvas>
      </div>

      {/* Content */}
      <div className="relative z-10">
        {/* Navigation */}
        <nav className="absolute top-0 left-0 right-0 p-6">
          <div className="max-w-7xl mx-auto flex items-center justify-between">
            <div className="flex items-center space-x-2">
              <Shield className="w-8 h-8 text-blue-500" />
              <span className="text-2xl font-bold text-white">Tele-Intelli</span>
            </div>
            <div className="flex items-center space-x-4">
              <Button
                variant="ghost"
                className="text-white hover:text-blue-400"
                onClick={() => setLoginOpen(true)}
              >
                Log in
              </Button>
              <Button
                className="bg-blue-600 hover:bg-blue-700 text-white"
                onClick={() => setSignupOpen(true)}
              >
                Get Started
              </Button>
            </div>
          </div>
        </nav>

        {/* Hero Section */}
        <div className="min-h-screen flex items-center justify-center p-6">
          <div className="max-w-4xl mx-auto text-center">
            <h1 className="text-5xl md:text-7xl font-bold text-white mb-6 tracking-tight">
              Secure Your Telegram
              <br />
              <span className="text-blue-500">With AI Intelligence</span>
            </h1>
            <p className="text-xl text-slate-300 mb-8 max-w-2xl mx-auto">
              Enhance your group chats with advanced security features powered by artificial intelligence. 
              Stay protected against spam, scams, and unwanted content.
            </p>
            <div className="flex flex-col sm:flex-row items-center justify-center gap-4">
              <Button
                size="lg"
                className="bg-blue-600 hover:bg-blue-700 text-white min-w-[200px]"
                onClick={() => setSignupOpen(true)}
              >
                Get Started
              </Button>
              <Button
                size="lg"
                variant="outline"
                className="text-white border-white hover:bg-white/10 min-w-[200px]"
              >
                Learn More
              </Button>
            </div>
          </div>
        </div>

        {/* Floating Icons */}
        <div className="absolute top-1/4 left-10 animate-float">
          <MessageCircle className="w-12 h-12 text-blue-500/50" />
        </div>
        <div className="absolute bottom-1/4 right-10 animate-float-delayed">
          <Shield className="w-12 h-12 text-blue-500/50" />
        </div>
        <div className="absolute top-1/2 right-1/4 animate-float">
          <AlertTriangle className="w-12 h-12 text-blue-500/50" />
        </div>
      </div>

      {/* Modals */}
      <LoginModal isOpen={isLoginOpen} onClose={() => setLoginOpen(false)} />
      <SignupModal isOpen={isSignupOpen} onClose={() => setSignupOpen(false)} />

      {/* Add required styles for animations */}
      <style jsx global>{`
        @keyframes float {
          0%, 100% { transform: translateY(0px); }
          50% { transform: translateY(-20px); }
        }
        .animate-float {
          animation: float 3s ease-in-out infinite;
        }
        .animate-float-delayed {
          animation: float 3s ease-in-out infinite;
          animation-delay: 1s;
        }
      `}</style>
    </div>
  );
}
